geregisseerd door Jeff Nichols
met Matthew McConaughey, Reese Witherspoon en Tye Sheridan

De gevaarlijke maar charismatische misdadiger Mud (Matthew McConaughey) is op de vlucht voor de wet en een aantal meedogenloze premiejagers. Hij raakt echter bevriend met de veertienjarige Ellis (Tye Sheridan) en diens vriend die bij de Mississippi rivier wonen. Mud weet hen te overtuigen hem te helpen aan de wet te ontsnappen en schakelt hun hulp in om zijn knipperlichtrelatie met zijn vriendin (Reese Witherspoon) te herstellen.



